import React from "react";
import "./Accueil.css"
function Accueil(){
    const image = "https://www.cmontmorency.qc.ca/wp-content/uploads/2022/09/MicrosoftTeams-image-3-1024x683.jpg"

    return (
        <div className="contenu-accueil">
            <img src={image} alt="Collège Montmorency" />
            <div className="contenu-accueil__texte">
                <h1>Description du site</h1>
                <p>Description du site à venir.</p>
            </div>
            

        </div>
    )
}

export default Accueil;
